import React from "react";
import "./style.css"

const Device = () => {
  return (
    <>
      <div className="device-list">
        <div className="container">
          <h1 className="title">Смартфоны</h1>
        </div>

        <div className="container">
          <div
            style={{
              marginRight: "50px",
              color: "#0D5ADC",
              marginTop: "100px",
              fontSize: "16px",
            }}
          >
            <input id="check" type={"checkbox"} />
            <label from="check">Показать различия</label>
          </div>
          <div>
            <p>ok</p>
          </div>
        </div>
      </div>
    </>
  );
};

export default Device;
